import DoctorSetupService from "../../service/setup/DoctorSetupService";
import RoleSetupService from "../../service/security/RoleSetupService";
import CommonService from "../../service/CommonService";
import BuildingSetupService from "../../service/setup/BuildingSetupService";
import RoomSetupService from "../../service/setup/RoomSetupService";
import ConsultancyDepartmentSetupService from "../../service/setup/ConsultancyDepartmentSetupService";
import DesignationSetupService from "../../service/setup/DesignationSetupService";
import ConsultancyTypeSetupService from "../../service/setup/ConsultancyTypeSetupService";
import DoctorAssistantSetupService from "../../service/setup/DoctorAssistantSetupService";
import ConsultantDegreeSetupService from "../../service/setup/ConsultantDegreeSetupService";
import Validation from "../../scripts/validation";
import { FilterMatchMode, FilterOperator } from "primevue/api";

export default {
  data() {
    return {
      isEmailValid: "",
      isPhoneValid: "",
      newInfo: false,
      dataList: true,
      active: 0,
      filters: {
        global: { value: null, matchMode: FilterMatchMode.CONTAINS },
        name: { value: null, matchMode: FilterMatchMode.STARTS_WITH },
      },
      initFilters() {
        this.filters = {
          global: { value: null, matchMode: FilterMatchMode.CONTAINS },
          name: {
            operator: FilterOperator.AND,
            constraints: [
              { value: null, matchMode: FilterMatchMode.STARTS_WITH },
            ],
          },
        };
      },
      doctorList: [],
      consultantDegreeList: [],
      doctorSetup: {
        //active: false,
        _createUser: false,
      },
      submitted: false,
      roleList: [],
      genderList: [],
      buildingList: [],
      roomList: [],
      departmentList: [],
      designationList: [],
      consultancyList: [],
      assistantList: [],
    };
  },

  created() {
    this.doctorSetupService = new DoctorSetupService();
    this.roleSetupService = new RoleSetupService();
    this.commonService = new CommonService();
    this.buildingSetupService = new BuildingSetupService();
    this.roomSetupService = new RoomSetupService();
    this.consultancyDepartmentSetupService =
      new ConsultancyDepartmentSetupService();
    this.designationSetupService = new DesignationSetupService();
    this.consultancyTypeSetupService = new ConsultancyTypeSetupService();
    this.doctorAssistantSetupService = new DoctorAssistantSetupService();
    this.consultantDegreeSetupService = new ConsultantDegreeSetupService();
    this.validation = new Validation();

    this.doctorSetupService
      .getAll()
      .then((data) => (this.doctorList = data.data));

    this.roleSetupService.getAll().then((data) => (this.roleList = data.data));

    this.commonService.GetAllGender().then(
      (data) =>
        //  console.log(data.data)
        (this.genderList = data.data)
    );

    this.buildingSetupService
      .getAll()
      .then((data) => (this.buildingList = data.data));

    this.roomSetupService.getAll().then((data) => (this.roomList = data.data));

    this.consultancyDepartmentSetupService
      .getActiveCombo()
      .then((data) => (this.departmentList = data.data));

    this.designationSetupService
      .getAll()
      .then((data) => (this.designationList = data.data));

    this.consultancyTypeSetupService
      .getAll()
      .then((data) => (this.consultancyList = data.data));

    this.doctorAssistantSetupService
      .getActiveCombo()
      .then((data) => (this.assistantList = data.data));

    this.consultantDegreeSetupService
      .getAll()
      .then((data) => (this.consultantDegreeList = data.data));
  },
  methods: {
    openNew() {
      this.isEmailValid = "";
      this.isPhoneValid = "";
      this.doctorSetup = {
        //active: false,
        _createUser: false,
      };
      this.active = 0;
      this.newInfo = true;
      this.dataList = false;
      this.submitted = false;
    },
    hideNew() {
      this.isEmailValid = "";
      this.isPhoneValid = "";
      this.doctorSetup = {
        //active: false,
        _createUser: false,
      };
      this.dataList = true;
      this.newInfo = false;
      this.submitted = false;
    },
    filterRoomsBuildingWise() {
      return this.roomList.filter(function (el) {
        return el.building_id === this.doctorSetup._building_id;
      }, this);
    },
    isEmailValidAndExists() {
      this.validation.isEmailValidAndExists(this.doctorList, 'email', this.doctorSetup.email, 'doctor_id', this.doctorSetup.doctor_id, this)
    },
    isPhoneValidAndExists() {
      this.validation.isPhoneValidAndExists(this.doctorList, 'phone_personal', this.doctorSetup.phone_personal, 'doctor_id', this.doctorSetup.doctor_id, this)
    },
    async add() {
      this.submitted = true;
      try {
        if (!this.doctorSetup.doctor_name) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.lstConsultantDegree) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.registration_no) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.gender) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.email) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.phone_personal) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup._building_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.room_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.department_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.designation_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.consultancy_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.consultancy_fee) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.report_visit_fee) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.second_con_fee) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.second_con_fee_duration) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.third_con_fee) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.third_con_fee_duration) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.doctorSetup.assitant_employee_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (
          this.doctorSetup.is_commission &&
          !this.doctorSetup.commission_rate
        ) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (
          !this.doctorSetup._password &&
          this.doctorSetup._createUser
        ) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else {
          if (!this.doctorSetup.doctor_id) {
            var doc = this.doctorSetup;
            let result = await this.doctorSetupService.add(doc);
            if (result.status === 201) {
              this.$toast.add({
                severity: "success",
                summary: "Success",
                detail: "Successfully Created",
                life: 10000,
              });
              this.hideNew();
              this.doctorSetupService
                .getAll()
                .then((data) => (this.doctorList = data.data));
            } else if (result.status === 401) {
              this.$toast.add({
                severity: "error",
                summary: "Error",
                detail: "Email already Used",
                life: 10000,
              });
            } else if (result.status === 400) {
              this.$toast.add({
                severity: "error",
                summary: "Error",
                detail: "Duplicate record",
                life: 10000,
              });
            } else {
              this.$toast.add({
                severity: "error",
                summary: "Faild",
                detail: result.res,
                life: 10000,
              });
            }
          } else if (this.isPhoneValid || this.isEmailValid) {
            return;
          } else {
            if (!this.doctorSetup._createUser) {
              this.doctorSetup._createUser = false;
            }
            let result = await this.doctorSetupService.put(
              this.doctorSetup,
              this.doctorSetup.doctor_id
            );
            if (result.status === 202) {
              this.$toast.add({
                severity: "success",
                summary: "Success",
                detail: "Updated Sucessfully",
                life: 10000,
              });
              this.hideNew();
              this.doctorSetupService
                .getAll()
                .then((data) => (this.doctorList = data.data));
            } else if (result.status === 401) {
              this.$toast.add({
                severity: "error",
                summary: "Error",
                detail: result.data,
                life: 10000,
              });
            } else {
              this.$toast.add({
                severity: "error",
                summary: "Faild",
                detail: result.res,
                life: 10000,
              });
            }
          }
        }
      } catch (error) {
        this.$toast.add({
          severity: "error",
          summary: "Faild",
          detail: error,
          life: 10000,
        });
      }
    },
    edit(obj) {
      this.doctorSetup = Object.assign({}, obj);

      this.dataList = false;
      this.newInfo = true;
    },
  },
};
